import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (using nav-menu text as selector)
    await page.waitForSelector('div.nav-menu', { timeout: 5000 });

    // Click the mobile menu trigger (using text content)
    const navMenu = await page.$('div.nav-menu');
    await navMenu.click();

    // Wait for the mobile menu overlay to appear (using id)
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Screenshot after menu opens
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Wait for a category link inside the mobile menu (using text selector for "Electronics")
    // Use xpath to ensure we get the link inside the overlay
    const electronicsLink = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//a[contains(text(),"Electronics")]',
      { timeout: 5000 }
    );

    // Click the "Electronics" link
    await electronicsLink.click();

    // Wait for the main content to update (look for "Electronics" heading)
    await page.waitForSelector('h2', { timeout: 5000 });
    // Confirm the heading is for Electronics
    const heading = await page.$eval('h2', el => el.textContent);
    const navigatedToElectronics = heading && heading.toLowerCase().includes('electronics');

    // Screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Re-open mobile menu to test close button
    await page.click('div.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Wait for close button (using class and visible text)
    const closeBtn = await page.waitForSelector(
      'xpath=//div[contains(@class,"mobile-menu")]//button[contains(@class,"close-mobile-menu")]',
      { timeout: 5000 }
    );
    await closeBtn.click();

    // Wait for overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Screenshot after closing menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu open, navigation to Electronics, and close actions.",
      extractedData: {
        navigatedToElectronics
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
